import React from 'react';

const AudioComponent = ({ audio }) => {
  return (
    <div style={{ padding: '1px' }}>
      {audio.title && audio.artist && audio.year && (
        <div>
          <h3>{audio.title}</h3>
          <p>Artist: {audio.artist}</p>
          <p>Year: {audio.year}</p>
        </div>
      )}
      {audio.episode && audio.episodeTitle && (
        <div>
          <h3>{audio.episodeTitle}</h3>
          <p>Episode: {audio.episode}</p>
          {audio.season && <p>Season: {audio.season}</p>}
          {audio.podcast && <p>Podcast: {audio.podcast}</p>}
        </div>
      )}
    </div>
  );
};

export default AudioComponent;
